static const char __pyx_k_Construct_a_timestamp_from_a_a[] = "\n        Construct a timestamp from a a proleptic Gregorian ordinal.\n\n        Parameters\n        ----------\n        ordinal : int\n            Date corresponding to a proleptic Gregorian ordinal.\n        freq : str, DateOffset\n            Offset to apply to the Timestamp.\n        tz : str, pytz.timezone, dateutil.tz.tzfile or None\n            Time zone for the Timestamp.\n\n        Notes\n        -----\n        By definition there cannot be any tz info on the ordinal itself.\n\n        Examples\n        --------\n        >>> pd.Timestamp.fromordinal(737425)\n        Timestamp('2020-01-01 00:00:00')\n        ";
static const char __pyx_k_Return_a_new_Timestamp_floored[] = "\n        Return a new Timestamp floored to this resolution.\n\n        Parameters\n        ----------\n        freq : str\n            Frequency string indicating the flooring resolution.\n        ambiguous : bool or {'raise', 'NaT'}, default 'raise'\n            The behavior is as follows:\n\n            * bool contains flags to determine if time is dst or not (note\n              that this flag is only applicable for ambiguous fall dst dates).\n            * 'NaT' will return NaT for an ambiguous time.\n            * 'raise' will raise an AmbiguousTimeError for an ambiguous time.\n\n        nonexistent : {'raise', 'shift_forward', 'shift_backward, 'NaT', timedelta}, default 'raise'\n            A nonexistent time does not exist in a particular timezone\n            where clocks moved forward due to DST.\n\n            * 'shift_forward' will shift the nonexistent time forward to the\n              closest existing time.\n            * 'shift_backward' will shift the nonexistent time backward to the\n              closest existing time.\n            * 'NaT' will return NaT where there are nonexistent times.\n            * timedelta objects will shift nonexistent times by the timedelta.\n            * 'raise' will raise an NonExistentTimeError if there are\n              nonexistent times.\n\n        Raises\n        ------\n        ValueError if the freq cannot be converted.\n\n        Notes\n        -----\n        If the Timestamp has a timezone, flooring will take place relative to the\n        local (\"wall\") time and re-localized to the same timezone. When flooring\n        near daylight savings time, use ``nonexistent`` and ``ambiguous`` to\n        control the re-localization behavior.\n\n        Examples\n        --------\n        Create a timestamp object:\n\n        >>> ts = pd.Timestamp('2020-03-14T15:32:52.192548651')\n\n        A timestamp can be floored using multiple frequency units:\n\n        >>> ts.floor(freq='H') # hour\n        Timestamp('2020-03""-14 15:00:00')\n\n        >>> ts.floor(freq='T') # minute\n        Timestamp('2020-03-14 15:32:00')\n\n        >>> ts.floor(freq='S') # seconds\n        Timestamp('2020-03-14 15:32:52')\n\n        >>> ts.floor(freq='N') # nanoseconds\n        Timestamp('2020-03-14 15:32:52.192548651')\n\n        ``freq`` can also be a multiple of a single unit, like '5T' (i.e.  5 minutes):\n\n        >>> ts.floor(freq='5T')\n        Timestamp('2020-03-14 15:30:00')\n\n        or a combination of multiple units, like '1H30T' (i.e. 1 hour and 30 minutes):\n\n        >>> ts.floor(freq='1H30T')\n        Timestamp('2020-03-14 15:00:00')\n\n        Analogous for ``pd.NaT``:\n\n        >>> pd.NaT.floor()\n        NaT\n\n        When rounding near a daylight savings time transition, use ``ambiguous`` or\n        ``nonexistent`` to control how the timestamp should be re-localized.\n\n        >>> ts_tz = pd.Timestamp(\"2021-10-31 03:30:00\").tz_localize(\"Europe/Amsterdam\")\n\n        >>> ts_tz.floor(\"2H\", ambiguous=False)\n        Timestamp('2021-10-31 02:00:00+0100', tz='Europe/Amsterdam')\n\n        >>> ts_tz.floor(\"2H\", ambiguous=True)\n        Timestamp('2021-10-31 02:00:00+0200', tz='Europe/Amsterdam')\n        ";
static const char __pyx_k_Return_an_period_of_which_this[] = "\n        Return an period of which this timestamp is an observation.\n\n        Examples\n        --------\n        >>> ts = pd.Timestamp('2020-03-14T15:32:52.192548651')\n        >>> # Year end frequency\n        >>> ts.to_period(freq='Y')\n        Period('2020', 'A-DEC')\n\n        >>> # Month end frequency\n        >>> ts.to_period(freq='M')\n        Period('2020-03', 'M')\n\n        >>> # Weekly frequency\n        >>> ts.to_period(freq='W')\n        Period('2020-03-09/2020-03-15', 'W-SUN')\n\n        >>> # Quarter end frequency\n        >>> ts.to_period(freq='Q')\n        Period('2020Q1', 'Q-DEC')\n        ";
